function dashboardcharts(){document.addEventListener("DOMContentLoaded",function(){axios.get("/dashboardgraph").then(function(a){var t=a.data,r=Object.keys(t),e=[];for(var o in t[r[0]]){var n=[];r.forEach(function(a){n.push(t[a][o]||0)}),e.push({label:o,data:n,backgroundColor:"rgba(54, 162, 235, 0.2)",borderColor:"rgba(54, 162, 235, 1)",borderWidth:1})}var d=document.getElementById("myChart").getContext("2d");new Chart(d,{type:"bar",data:{labels:r,datasets:e},options:{scales:{yAxes:[{ticks:{beginAtZero:!0}}]}}})}).catch(function(a){console.error("Error fetching chart data:",a)})})}dashboardcharts();